helpcount=23
help0=Usage:
help1=\  java SumCubes --algorithm=BRUTEFORSE [--help] [--min=1] [--max=50] [--writeinfooff] [--writesolutionon]\n		
help2=Usage examples:
help3=\  java SumCubes --algorithm=THEFASTEST --min=1 --max=500 --writeinfooff --writesolutionon
help4=\  launching the THEFASTEST algorithm with the parameters min=1, max=500, switching off the service information and outputting the calculated solutions of the equation.\n
help5=\  java SumCubes --algorithm=THEFASTEST --algorithm=BRUTEFORSEFASTER --min=1 --max=500 --algorithm=BRUTEFORSE --min=100 --max=400
help6=\  sequential launch of the algorithm: \n    THEFASTEST algorithm with the default parameters min=1, max=1000;\n    BRUTEFORSEFASTER algorithm with the parameters min=1, max=500;\n    BRUTEFORSE algorithm with the parameters min=100, max=400.\n
help7=Available options\n
help8=\  --algorithm=name           required parameter, you can list several algorithms
help9=\  or -a=name                 that will be executed one after another		
help10=\                             where valid names are: bruteforse [or BRUTEFORSE or
help11=\                             BF], bruteforsefaster [or BRUTEFORSEFASTER or BFF],
help12=\                             thefastest [or THEFASTEST or TF]\n
help13=\  --help or -h               displays this message\n
help14=\  --min=1                    optional parameter, specifies the minimum value for
help15=\                             the algorithm\n
help16=\  --max=50                   optional parameter, specifies the maximum value for
help17=\                             the algorithm\n
help18=\  --writeinfooff             disables output of service information\n
help19=\  --writesolutionon          displays the results of solving a cubic equation\n
help20=additional commands \navailable interactively:\n(all commands in interactive mode are entered without prefixes - and --)
help21=\  run                        runs the specified algorithms\n
help22=\  exit                       exit interactive mode
